import axios from 'axios';
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import '../css/pageAdmi.css';

const ProductsStock = () => {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    // Realiza una solicitud GET al backend para obtener la lista de productos
    axios
      .get('http://localhost:8000/api/products') // Reemplaza con la URL correcta de tu backend
      .then((response) => {
        setProducts(response.data);
      })
      .catch((error) => {
        console.error('Error al obtener la lista de productos:', error);
      });
  }, []);

  const handleEdit = (productId) => {
    // Lógica para editar un producto, por ejemplo, redirigir a una página de edición.
    // Puedes implementar esto según tus necesidades.
  };

  const handleToggleDelivered = (productId) => {
    // Lógica para marcar o desmarcar un producto como entregado en el servidor.
    // Puedes implementar esto según tus necesidades.

    // Aquí podrías realizar una solicitud PATCH o PUT al servidor para actualizar el campo 'delivered'.
  };

  return (
    <div className="App">
      <div className="main-section">
        <Sidebar />
        <Content
          products={products}
          handleEdit={handleEdit}
          handleToggleDelivered={handleToggleDelivered}
        />
      </div>
    </div>
  );
};

function Sidebar() {
  return (
    <div className="sidebar">
      <ul>
        <li><a href="/pageAdmi">Inicio</a></li>
        <li><a href="#">Usuarios</a></li>
        <li><a href="/products">Productos</a></li>
        <li><a href="/">Pedidos</a></li>
        <li><a href="/">Salir</a></li>
      </ul>
    </div>
  );
}

function Content({ products, handleEdit, handleToggleDelivered }) {
  return (
    <div className="content">
      <h1>PRODUCTOS EN STOCK</h1>
      <Link to="/products/create" className="productos-button">Agregar producto</Link>
      <div className="carrito-container">
        <table className="carrito-table">
          <thead>
            <tr>
              <th>Nombre</th>
              <th>Precio</th>
              <th>Descripción</th>
              <th>Imagen</th>
              <th>Entregado</th>
              <th>Acciones</th>
            </tr>
          </thead>
          <tbody>
            {products.map((product) => (
              <tr key={product.id}>
                <td>{product.product_name}</td>
                <td>{product.price}</td>
                <td>{product.description}</td>
                <td>
                  <img src={product.image} alt={product.product_name} />
                </td>
                <td>
                  <input
                    type="checkbox"
                    checked={product.delivered}
                    onChange={() => handleToggleDelivered(product.id)}
                  />
                </td>
                <td>
                  <button onClick={() => handleEdit(product.id)}>Editar</button>
                  {/* Puedes agregar botones para eliminar productos aquí si es necesario */}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default ProductsStock;
